@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:PasswordValidationResult rdf:type owl:Class .

:ValidPassword rdf:type owl:Class ;
    rdfs:subClassOf :PasswordValidationResult .

:InvalidPassword rdf:type owl:Class ;
    rdfs:subClassOf :PasswordValidationResult .

:hasPasswordValidationResult rdf:type owl:ObjectProperty ;
    rdfs:domain :Customer ;
    rdfs:range :PasswordValidationResult .
